import axios from 'axios'
import React from 'react'

const Cart = () => {
    const [cartItem,setCartItem] = useState([])
    axios.get('http://localhost:3003/getcartitems').then(res=>console.log(res)).catch(err=>console.log(err))
  return (
    <div>
        {cartItem&&cartItem.map(item=>{
            <div>
            {item.Dname}
            </div>
        })}

    </div>
  )
}

export default Cart
